        public static int LargestRectangleArea(int[] heights)
        {
            if (heights.Length == 0)
            {
                return 0;
            }
            var result = heights[0];
            var maxHeight = 0;
            var near = false;
            for(var i = 0; i < heights.Length; i++)
            {                
                var current = heights[i];
                if (near)
                {
                    if (maxHeight == current)
                    {
                        continue;
                    }
                    else
                    {
                        near = false;
                    }
                }
                var left = i == 0 ? 0 : i - 1;
                var right = i==heights.Length-1?heights.Length-1:i+1;                
                while (left >= 0)
                {
                    if (heights[left] >= current)
                    {
                        left--;
                        continue;
                    }
                    else
                    {
                        left++;
                        break;
                    }
                }
                left = left < 0 ? 0 : left;

                while (right < heights.Length)
                {
                    if (heights[right] >= current)
                    {
                        right++;
                        continue;
                    }
                    else
                    {
                        right--;
                        break;
                    }
                }
                right = right >= heights.Length ? heights.Length - 1 : right;
                var tempResult = current * (right - left + 1);
                if (tempResult > result)
                {
                    result = tempResult;
                    near = true;
                    maxHeight = current;
                }                

            }

            return result;
        }


